import React, { useState } from "react";
import EditorFinal from "./Editor/EditorFinal";
import "./Homestyle.css";
import Chatbot from "./Chatbot/Chatbot";
import Projects from "./Projects/Projects";
import Roadmap from "./Roadmap/Roadmap";
import { NavLink } from "react-router-dom";

const Home = (props) => {
  return (
    <div>
      <div className="home-nav">
        <h2>ALT-F4</h2>
        <div className="right">
          <NavLink activeClassName="active" exact to="/EditorFinal" className="EditorLink">
            Editor
          </NavLink>
          <NavLink  activeClassName="active" exact to="/Roadmap" className="EditorLink">
            Roadmap
          </NavLink>
          <NavLink activeClassName="active" exact to="/Projects" className="EditorLink">
            Projects
          </NavLink>
        </div>
      </div>
      <Chatbot />
    </div>
  );
};

export default Home;
